using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace _13zadanie
{
    class Program
    {
        static void Main(string[] args)
        {
            string t, s = "";

            t = Console.ReadLine();
            if (t.Length < 1 || t.Length > 1)
            {
                Console.WriteLine("Вводимая строка должна содержать ровно 1 символа");
                return;

            }
            int i = 0;

            while ((i = s.IndexOf(t, i)) != -1)
            {

                Console.Write(i + " ");
                i += t.Length;
            }

        }
    }
}
